import logo from './logo.svg';
import './App.css';
import React from 'react';

class App extends React.Component {
  render() {
    return (
      <div>
        <h1>StudyBear</h1>
        <p>How it works</p>
        <p>About</p>
        <p>Contact Us</p>
      </div>
    );
  }
}

export default App;
